import { render } from "@testing-library/react"
import ReactDOM from "react-dom";
import Model from "./Model";
ReactDOM.render(
    <table>
        <tr>
            <td><Model/></td>
            <td><Classe/></td>
        </tr>
        <tr>
             <td><Model/></td>
            <td><Cclass/></td>
        </tr>
    </table>,
    document.getElementById("root")
    );
    function Classe(){
        return "E-Class"
    }
    
    function Cclass(){
        return "C-Class"
    }
